    if(isNameAvilable){
        return (<h1>Hello {name}!</h1>)
    }
    else{
      return (<>
        <h1>Good Morning, to all!</h1>
        <h2>Have a great day!</h2>
      </>)
    }
  }

function App() {

  return (
    <div className="App">
      <RenderName/>
    </div>
  );
}

export default App;
